def adi_part8(n: int, X: List[List[int]], A: List[List[int]], B: List[List[int]]) -> List[List[int]]:
    return matrix_elemwise_div(
        matrix_elemwise_sub(
            matrix_row_slice(X, n-2, n),
            matrix_elemwise_mul(
                matrix_row_slice(X, n-3, n-1),
                matrix_row_slice(A, n-3, n-1)
            )
        ),
        matrix_row_slice(B, n-2, n)
    )
